export default function Recipes() {
  return (
    <div>
      Recipes
      {MealType.map((diet, index) => (
        <RecipeFormButton
          text={diet}
          value={diet}
          // getValue={props.updateDiet}
          key={index}
        />
      ))}
    </div>
  );
}
